        <section id="emergency-contacts">
            <h2>Emergency Contacts</h2>
            <p>If you are in immediate danger, please call your local emergency services.</p>
            <ul>
                <li><strong>Police:</strong> 911 (or your local emergency number)</li>
                <li><strong>Domestic Violence Hotline:</strong> 1-800-799-7233</li>
                <li><strong>National Sexual Assault Hotline:</strong> 1-800-656-4673</li>
                <li><strong>Local Women's Shelter:</strong> [Insert local shelter contact]</li>
            </ul>
        </section>

        <section id="resources">
            <h2>Resources</h2>
            <p>Here are some resources that can help you:</p>
            <ul>
                <li><a href="https://www.rainn.org/">RAINN (Rape, Abuse & Incest National Network)</a></li>
                <li><a href="https://www.thehotline.org/">National Domestic Violence Hotline</a></li>
                <li><a href="https://www.womenslaw.org/">Women's Law</a></li>
                <li><a href="https://www.nsvrc.org/">National Sexual Violence Resource Center</a></li>
            </ul>
        </section>

